INSERT INTO `website` VALUES ('27070f3bb6aa1a873c931969c1aa6b6c','Python Programming Patterns','By Thomas W. Christopher; Prentice Hall PTR, 2002, ISBN 0130409561. Shows how to write large programs, introduces powerful design patterns that deliver high levels of robustness, scalability, reuse.\r','http://www.pearsonhighered.com/educator/academic/product/0,,0130409561,00%2Ben-USS_01DBC.html','2016-02-12 11:10:05'),('29e157dbede7043a331a031e341c1148','Pro Python System Administration','By Rytis Sileika, ISBN13: 978-1-4302-2605-5, Uses real-world system administration examples like manage devices with SNMP and SOAP, build a distributed monitoring system, manage web applications and parse complex log files, monitor and manage MySQL databases.\r','http://sysadminpy.com/','2016-02-12 11:10:05'),('2dfcf3f4653973027d484c6be4b99ac2','FreeTechBooks: Python Scripting Language','Annotated list of free online books on Python scripting language. Topics range from beginner to advanced.\r','http://www.freetechbooks.com/python-f6.html','2016-02-12 11:10:05'),('4885fd54bb34282d8c7c0b2e1ed9ad9e','Practical Python','By Magnus Lie Hetland; Apress LP, 2002, ISBN 1590590066. Readable guide to ideas most vital to new users, from basics common to high level languages, to more specific aspects, to a series of 10 ever more complex programs. [Apress]\r','http://hetland.org/writing/practical-python/','2016-02-12 11:10:05'),('5b1b6b1f531b5647a617eda4cac04325','How to Think Like a Computer Scientist: Learning with Python','By Allen B. Downey, Jeffrey Elkner, Chris Meyers; Green Tea Press, 2002, ISBN 0971677506. Teaches general principles of programming, via Python as subject language. Thorough, in-depth approach to many basic and intermediate programming topics. Full text online and downloads: HTML, PDF, PS, LaTeX. [Free, Green Tea Press]\r','http://greenteapress.com/thinkpython/','2016-02-12 11:10:05'),('5bfd1be1d284e7639a42e7446f2f0279','O\'Reilly Python Center','Features Python books, resources, news and articles.\r','http://oreilly.com/python/','2016-02-12 11:10:05'),('5eafe18e33da69d0c0650b6fe358ea30','Python Language Reference Manual','By Guido van Rossum, Fred L. Drake, Jr.; Network Theory Ltd., 2003, ISBN 0954161785. Printed edition of official language reference, for v2.x, from Python.org, describes syntax, built-in datatypes. [Network Theory, online]\r','http://www.network-theory.co.uk/python/language/','2016-02-12 11:10:05'),('7dcc7c487016b02a340e8d8a4ef852ea','An Introduction to Python','By Guido van Rossum, Fred L. Drake, Jr.; Network Theory Ltd., 2003, ISBN 0954161769. Printed edition of official tutorial, for v2.x, from Python.org. [Network Theory, online]\r','http://www.network-theory.co.uk/python/intro/','2016-02-12 11:10:05'),('83f07a24d7846a2e78737e9b67dde503','Python Programming with the Java Class Libraries: A Tutorial for Building Web and Enterprise Applications with Jython','By Richard Hightower; Addison-Wesley, 2002, 0201616165. Begins with Python basics, many exercises, interactive sessions. Shows programming novices concepts and practical methods. Shows programming experts Python\'s abilities and ways to interface with Java APIs. [publisher website]\r','http://www.informit.com/store/product.aspx?isbn=0201616165&redir=1','2016-02-12 11:10:05'),('8f5410fa3520252e15acfa4cdd6db2a9','Free Python books','Free Python books and tutorials.\r','http://www.techbooksforfree.com/perlpython.shtml','2016-02-12 11:10:05'),('984c8de4649ffb8e1b667c76799a7135','Sams Teach Yourself Python in 24 Hours','By Ivan Van Laningham; Sams Publishing, 2000, ISBN 0672317354. Split into 24 hands-on, 1 hour lessons; steps needed to learn topic: syntax, language features, OO design and programming, GUIs (Tkinter), system administration, CGI. [Sams Publishing]\r','http://www.informit.com/store/product.aspx?isbn=0672317354','2016-02-12 11:10:05'),('9e766c65fc7c9c894f50ca036737ce53','eff-bot\'s Daily Python URL','Contains links to assorted resources from the Python universe, compiled by PythonWare.\r','http://www.pythonware.com/daily/','2016-02-12 11:10:05'),('a1ca1c97aa01e1b023ef000c69f4e61d','Core Python Programming','By Wesley J. Chun; Prentice Hall PTR, 2001, ISBN 0130260363. For experienced developers to improve extant skills; professional level examples. Starts by introducing syntax, objects, error handling, functions, classes, built-ins. [Prentice Hall]\r','http://www.pearsonhighered.com/educator/academic/product/0,,0130260363,00%2Ben-USS_01DBC.html','2016-02-12 11:10:05'),('a3145d8e6a331d3d09b9fcec6945d2e6','Learn to Program Using Python','Book by Alan Gauld with full text online. Introduction for those learning programming basics: terminology, concepts, methods to write code. Assumes no prior knowledge but basic computer skills.\r','http://www.freenetpages.co.uk/hp/alan.gauld/','2016-02-12 11:10:05'),('a9eb98ebc052ba973e203c30ecb86220','Python 2.1 Bible','By Dave Brueck, Stephen Tanner; John Wiley and Sons, 2001, ISBN 0764548077. Full coverage, clear explanations, hands-on examples, full language reference; shows step by step how to use components, assemble them, form full-featured programs. [John Wiley and Sons]\r','http://www.wiley.com/WileyCDA/WileyTitle/productCd-0764548077.html','2016-02-12 11:10:05'),('b0007c4694e252d300f347072684f1a5','Python Developer\'s Guide','Resources for reporting bugs, accessing the Python source tree with CVS and taking part in the development of Python.\r','https://www.python.org/dev/','2016-02-12 11:10:05'),('b38e44c7a688ed306b461e36e0c0ae70','Dive Into Python 3','By Mark Pilgrim, Guide to Python 3  and its differences from Python 2. Each chapter starts with a real code sample and explains it fully. Has a comprehensive appendix of all the syntactic and semantic changes in Python 3\r','http://www.diveintopython.net/','2016-02-12 11:10:05'),('ba8b2830afefc16783b04bab93f4824c','Foundations of Python Network Programming','This book covers a wide range of topics. From raw TCP and UDP to encryption with TSL, and then to HTTP, SMTP, POP, IMAP, and ssh. It gives you a good understanding of each field and how to do everything on the network with Python.\r','http://rhodesmill.org/brandon/2011/foundations-of-python-network-programming/','2016-02-12 11:10:05'),('bdcb63bc9892898872ab4e513a468c52','Making Use of Python','By Rashi Gupta; John Wiley and Sons, 2002, ISBN 0471219754. Covers language basics, use for CGI scripting, GUI development, network programming; shows why it is one of more sophisticated of popular scripting languages. [Wiley]\r','http://www.wiley.com/WileyCDA/WileyTitle/productCd-0471219754.html','2016-02-12 11:10:05'),('c0d8f602807ce951923dc6ccdc69e36b','Data Structures and Algorithms with Object-Oriented Design Patterns in Python','The primary goal of this book is to promote object-oriented design using Python and to illustrate the use of the emerging object-oriented design patterns.\r','http://www.brpreiss.com/books/opus7/html/book.html','2016-02-12 11:10:05'),('d72864c900f4659fa40722d38119165f','Social Bug','Scripts, examples and news about Python programming for the Windows platform.\r','http://win32com.goermezer.de/','2016-02-12 11:10:05'),('dbc1375c2951232130bf673b514e8112','Programming in Python 3 (Second Edition)','A Complete Introduction to the Python 3.\r','http://www.qtrac.eu/py3book.html','2016-02-12 11:10:05'),('eec63dd1ae46da3f1279d276635b3a59','Python 3 Object Oriented Programming','A step-by-step tutorial for OOP in Python 3, including discussion and examples of abstraction, encapsulation, information hiding, and raise, handle, define, and manipulate exceptions.\r','https://www.packtpub.com/python-3-object-oriented-programming/book','2016-02-12 11:10:05'),('f3b8be94b147b56f0b0ae9a5f74db19a','XML Processing with Python','By Sean McGrath; Prentice Hall PTR, 2000, ISBN 0130211192, has CD-ROM. Methods to build XML applications fast, Python tutorial, DOM and SAX, new Pyxie open source XML processing library. [Prentice Hall PTR]\r','http://www.informit.com/store/product.aspx?isbn=0130211192','2016-02-12 11:10:05'),('f9500c7171f9372444dbc740153adea8','Python: Visual QuickStart Guide','By Chris Fehily; Peachpit Press, 2002, ISBN 0201748843. Task-based, step-by-step visual reference guide, many screen shots, for courses in digital graphics; Web design, scripting, development; multimedia, page layout, office tools, operating systems. [Prentice Hall]\r','http://www.pearsonhighered.com/educator/academic/product/0,,0201748843,00%2Ben-USS_01DBC.html','2016-02-12 11:10:05'),('fc7c44e19b4432363453890d8f1dee78','Text Processing in Python','By David Mertz; Addison Wesley. Book in progress, full text, ASCII format. Asks for feedback. [author website, Gnosis Software, Inc.]\r','http://gnosis.cx/TPiP/','2016-02-12 11:10:05');
